import React, { useState } from 'react';
import {
    Box, Typography, Paper, TextField, Button, Snackbar, Alert,
    CircularProgress, Container
} from '@mui/material';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const JoinQueue: React.FC = () => {
    const [formData, setFormData] = useState({
        name: '',
        phone: ''
    });
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState<string | null>(null);
    const [success, setSuccess] = useState(false);
    
    const navigate = useNavigate();

    const handleInputChange = (e: React.ChangeEvent<HTMLInputElement>) => {
        const { name, value } = e.target;
        setFormData(prev => ({
            ...prev,
            [name]: value
        }));
    };

    const handleSubmit = async (e: React.FormEvent) => {
        e.preventDefault();
        
        // Validate
        if (!formData.name.trim() || !formData.phone.trim()) {
            setError('Vui lòng điền đầy đủ thông tin');
            return;
        }
        
        try {
            setLoading(true);
            setError(null);
            
            // Gửi dữ liệu lên server
            await axios.post('/api/queue/add_to_queue/', formData);
            
            // Hiển thị thông báo thành công
            setSuccess(true);
            
            // Chuyển hướng đến trang xem hàng đợi sau 2 giây
            setTimeout(() => {
                navigate('/queue-view');
            }, 2000);
            
        } catch (err: any) {
            console.error('Error joining queue:', err);
            setError(err.response?.data?.error || 'Lỗi khi đăng ký vào hàng đợi');
        } finally {
            setLoading(false);
        }
    };

    const handleCloseSnackbar = () => {
        setSuccess(false);
    };

    return (
        <Container maxWidth="sm">
            <Box sx={{ 
                display: 'flex', 
                flexDirection: 'column', 
                alignItems: 'center',
                justifyContent: 'center',
                minHeight: '100vh',
                py: 4
            }}>
                <Paper 
                    elevation={3} 
                    sx={{ 
                        p: 4, 
                        width: '100%', 
                        borderRadius: 2,
                        bgcolor: 'background.paper'
                    }}
                >
                    <Typography variant="h4" component="h1" gutterBottom align="center">
                        Đăng ký vào hàng đợi
                    </Typography>
                    
                    <Typography variant="body1" paragraph align="center" color="text.secondary">
                        Vui lòng điền thông tin của bạn để đăng ký vào hàng đợi
                    </Typography>
                    
                    {error && (
                        <Alert severity="error" sx={{ mb: 2 }}>
                            {error}
                        </Alert>
                    )}
                    
                    <Box component="form" onSubmit={handleSubmit} noValidate>
                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="name"
                            label="Họ và tên"
                            name="name"
                            autoComplete="name"
                            autoFocus
                            value={formData.name}
                            onChange={handleInputChange}
                            disabled={loading}
                        />
                        
                        <TextField
                            margin="normal"
                            required
                            fullWidth
                            id="phone"
                            label="Số điện thoại"
                            name="phone"
                            autoComplete="tel"
                            value={formData.phone}
                            onChange={handleInputChange}
                            disabled={loading}
                        />
                        
                        <Button
                            type="submit"
                            fullWidth
                            variant="contained"
                            sx={{ mt: 3, mb: 2, py: 1.5 }}
                            disabled={loading}
                        >
                            {loading ? (
                                <CircularProgress size={24} sx={{ color: 'white' }} />
                            ) : (
                                'Đăng ký'
                            )}
                        </Button>
                        
                        <Button
                            fullWidth
                            variant="outlined"
                            sx={{ mb: 1 }}
                            onClick={() => navigate('/queue-view')}
                            disabled={loading}
                        >
                            Xem danh sách hàng đợi
                        </Button>
                    </Box>
                </Paper>
                
                <Box sx={{ mt: 2, textAlign: 'center' }}>
                    <Typography variant="body2" color="text.secondary">
                        © {new Date().getFullYear()} Gamine Restaurant
                    </Typography>
                </Box>
            </Box>
            
            <Snackbar 
                open={success} 
                autoHideDuration={2000} 
                onClose={handleCloseSnackbar}
                anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
            >
                <Alert onClose={handleCloseSnackbar} severity="success" sx={{ width: '100%' }}>
                    Đăng ký thành công! Chuyển hướng đến trang xem hàng đợi...
                </Alert>
            </Snackbar>
        </Container>
    );
};

export default JoinQueue;
